import React, { Component } from "react";
import Form from "./form";

class Modal extends Component {

  render() {
    if(!this.props.showModal){
      return null;
    }
    return (
      <div onClick={this.props.onClose}>
        <h2>Fill Address details</h2>
        <Form />
      </div>
    );
  }
}

export default Modal;
